def js_to_json(code):
    import re
    import json
    def fix_kv(m):
        v = m.group(0)
        if v in ('true', 'false', 'null'):
            return v
        elif v.startswith('/*') or v.startswith('//') or v == ',':
            return ""

        if v[0] in ("'", '"'):
            v = re.sub(r'(?s)\\.|"', lambda m: {
                '"': '\\"',
                "\\'": "'",
                '\\\n': '',
                '\\x': '\\u00',
            }.get(m.group(0), m.group(0)), v[1:-1])

        if v.startswith(('0x', '0X')):
            return str(int(v, 16))
        elif v.startswith('0'):
            return str(int(v, 8))
        else:
            return v

    return re.sub(r'(?s)(?<!\\)"([^"\\]*(?:\\[\s\S][^"\\]*)*)"|\'([^\'\\]*(?:\\[\s\S][^\'\\]*)*)\'', lambda m: '"' + fix_kv(re.match(r'\'[^\']*\'|"[^"]*"', m.group(0))) + '"', code)
